module.exports = "<header-component></header-component>\n\n\n<div class=\"page\">\n\n\n    <div class=\"jumbotron\">\n  <h1 class=\"display-3\">위세너 LMS</h1>\n  <p class=\"lead\">\n      본 LMS 는 위세너에서 직접 개발한 것으로,\n      학생과 수업 관리를 할 수 있습니다.\n      </p>\n  <hr class=\"my-4\">\n  <p>\n      궁금한 점이나 개선 사항이 있으시면 아래의 연락처를 참조하시어 연락주시면 됩니다.\n      </p>\n  <p class=\"lead\">\n    <a class=\"btn btn-primary btn-lg\" routerLink=\"/\" role=\"button\">메인으로</a>\n  </p>\n</div>\n\n\n\n<div class=\"alert alert-info\" role=\"alert\">\n    <strong>연락처</strong>\n    전화: 070-7893-1741 ( 평일 오후 3시부터 밤 12시까지 )\n\n</div>\n\n<p>\n    위세는 2007년 온라인 화상영어 교육 사업을 창업 한 이래 많은 협력 업체와 안정적으로\n    꾸준히 화상영어 교육을 하고 있습니다.\n</p>\n\n<p>\n    위세너는 2008년 마닐라에 필리핀 현지 화상 영어 교육 콜센터를 설립한 후, 클락 등을 거쳐 현재 필리핀 팜팡가에 화상 센터를 두고 있습니다.\n</p>\n\n<p>\n    좋은 선생님과 좋은 커리큘럼으로 수업을 하기 위해서 늘 최선을 다하고 있으며, 특히 화상영어 수업에 필요한 홈페이지, LMS, 솔루션 등을 직접 제작해서 수업에 활용하고 있습니다.\n</p>\n\n</div>\n\n"

